The 1973 BBC television adaption of Charlotte Bronte's classic novel. Jane Eyre is a poor orphan, brought up by a wealthy Aunt who is determined she should never forget her impoverished background. Surviving the cruelty of an oppressive boarding school, she becomes the governess of Thornfield Hall, owned by the enigmatic and rarely seen Mr Rochester. When Jane finally meets Mr Rochester in the flesh, she is consumed by an overwhelming attraction towards him that soon becomes mutual. However, their hopes for happiness are soon jeopardized by a terrible secret.


